import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";

export default function CoupleDashboard() {
  const [userData, setUserData] = useState(null);
  const [loading, setLoading] = useState(true);
  const navigate = useNavigate();

  const email = localStorage.getItem("userEmail"); 
  const authToken = localStorage.getItem("authToken");
  const userRole = localStorage.getItem("userRole");

  useEffect(() => {
    if (!authToken || !email || userRole !== "Couple") {
      navigate("/login");
      return;
    }

    const fetchUserData = async () => {
      try {
        const response = await fetch(`http://localhost:3000/api/couple/dashboard/${email}`, {
          headers: { Authorization: `Bearer ${authToken}` },
        });
        const data = await response.json();

        if (data.status === "success") {
          setUserData(data.data);
        } else {
          console.error("Failed to fetch couple data:", data.message);
        }
      } catch (error) {
        console.error("Error fetching couple data:", error);
      } finally {
        setLoading(false);
      }
    };

    fetchUserData();
  }, [email, authToken, userRole, navigate]);

  const handleLogout = () => {
    localStorage.clear();
    navigate("/login");
  };

  if (loading) {
    return <div className="flex justify-center items-center min-h-screen">Loading...</div>;
  }

  return (
    <div className="min-h-screen bg-blue-100">
      {/* Header */}
      <header className="bg-orange-300 p-4 flex justify-between items-center fixed w-full top-0 left-0 z-10">
        <img src="WEDNEST_LOGO.png" alt="WedNest Logo" className="h-24 w-auto" />
        <div className="flex gap-4">
          <button className="text-lg">Home</button>
          <span className="text-lg">🛒</span>
          <span className="text-lg">👤</span>
        </div>
      </header>

      {/* Sidebar (Fixed to the left and below header) */}
      <div className="fixed left-0 top-[100px] w-1/5 h-[calc(100vh-100px)] bg-cover bg-center flex flex-col items-center justify-center space-y-6 px-4" 
           style={{ backgroundImage: "url('/sidebar.png')" }}>
        <h2 className="text-lg font-semibold text-black">Welcome</h2>
        <div className="w-32 h-32 bg-gray-400 rounded-full"></div>
        <p className="font-semibold text-black text-center">@{userData?.username || "Loading..."}</p>
        <p className="text-black text-center">{userData?.email || "No email found"}</p>
        <button className="bg-blue-500 text-white px-6 py-2 rounded">Edit Profile</button>
      </div>

      {/* Main Content (Shifted Right to Avoid Sidebar Overlap) */}
      <div className="pl-[20%] pt-[120px]">
        <div className="grid grid-cols-4 gap-6 p-6">
          <div className="col-span-2 flex flex-col gap-6 items-center">
            <div className="p-4 rounded-lg text-black bg-cover bg-center w-3/4" style={{ backgroundImage: "url('/bgcouple.jpg')" }}>
              <h2 className="text-lg font-semibold">Budget</h2>
              <p>Budget Set: ${userData?.budget || 0}</p>
              <p>Remaining: ${userData?.remaining_budget || 0}</p>
            </div>

            <div className="p-4 rounded-lg text-center text-black bg-cover bg-center w-3/4" style={{ backgroundImage: "url('/bgcouple.jpg')" }}>
              <h2 className="text-lg font-semibold">Welcome Back, {userData?.username || "User"}!</h2>
              <p>Your big day on: {userData?.wedding_date || "Not Set"}</p>
            </div>
          </div>

          <div className="absolute right-0 p-4 right-0rounded-lg text-black bg-cover bg-center min-h-[800px] min-w-[400px] " style={{ backgroundImage: "url('/bgcouple.jpg')" }}>
            <h2 className="text-lg text-center font-semibold">Vendors Booked</h2>
            <p>Shows vendor name and service type</p>
          </div>
        </div>

        <div className="text-center mt-6">
          <button onClick={handleLogout} className="bg-red-500 text-white px-6 py-2 rounded">Log Out</button>
        </div>
      </div>
    </div>
  );
}
